class MappingABC {
	public:
	int countStrings(vector <int> t) {
		init();
		set<ll> ss;
		for (auto &w:t) ss.insert(w);
		for (auto &w:ss) vs.PB(w);
		n=t.size();
		memset(fst,0,sizeof fst);
		memset(seen,0,sizeof seen);
		for (ll i=0;i<n;i++) {
			if (!seen[t[i]]) {fst[i]=true;seen[t[i]]=true;}
		}
		memset(ran,0,sizeof ran);
		for (ll x=0;x<n;x++) {
			ran[t[x]][x+1]++;
		}
		for (auto &s:vs) {
			for (ll x=1;x<=n;x++) {
				ran[s][x]+=ran[s][x-1];
				//printf("s:%lld x:%lld r:%lld\n",s,x,ran[s][x]);
			}
		}
		ll ans=0;
		for (k=0;k<2;k++) {
			final=0;
			for (a=0;a<n;a++) {
				if (!fst[a]) continue;
				b=-1;
				memset(seen,0,sizeof seen);
				for (ll x=a+1;x<n;x++) {
					//printf("a:%lld f:%d x:%lld f:%d\n",a,fst[a],x,fst[x]);
					if (!seen[t[x]]) {
						seen[t[x]]=true;
						b=x; break;
					}
				}
				if (b==-1) continue;
				memset(cnt,0,sizeof cnt);
				for (auto &s:vs) {
					st[s]=getsig(s);
					cnt[st[s]]++;
				}
				//printf("init a:%lld b:%lld k:%lld\n",a,b,k);
				//for (auto &s:vs) printf("s:%lld st:%lld\n",s,st[s]);
				addfinal();
				vector<ll> undone;
				undone.PB(b);
				for (ll x=b+1;x<n;x++) {
					undone.PB(x);
					if (!seen[t[x]]) {
						seen[t[x]]=true;
						b=x;
						for (auto &us:undone) updatesig(t[us]);
						undone.clear();
						//printf("a:%lld b:%lld k:%lld\n",a,b,k);
						//for (auto &s:vs) printf("s:%lld st:%lld\n",s,st[s]);
						addfinal();
						undone.PB(x);
					}
				}
			}
			if (k==0) {
				ans+=(MOD-final);
			}
			else {
				ans+=final;
			}
		}
		return ans%MOD;
	}
};
